import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 20, height: 20, viewBox: "0 0 20 20", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M11 10a2 2 0 011.7.94 3 3 0 00-.2 1.06v.06A2 2 0 0011 14v2.32c-.9.43-2.09.68-3.5.68C4.09 17 2 15.55 2 13.5V12c0-1.1.9-2 2-2h7zm1 4a1 1 0 011-1h.5v-1a1.99 1.99 0 012-2 2 2 0 012 2v1h.5a1 1 0 011 1v4a1 1 0 01-1 1h-5a1 1 0 01-1-1v-4zm4.07 1.51a.75.75 0 00-.57-.26.75.75 0 10.57.26zM15.5 11a1 1 0 00-1 1v1h2v-1a1 1 0 00-1-1zm-2.25-.98l.01-.02h-.02v.02zM7.5 2a3.5 3.5 0 110 7 3.5 3.5 0 010-7zm7 2a2.5 2.5 0 110 5 2.5 2.5 0 010-5z", fill: primaryFill }));
};
const PeopleLock20Filled = wrapIcon(rawSvg({}), 'PeopleLock20Filled');
export default PeopleLock20Filled;
